const hitBase64 = "data:audio/wav;base64,";

const minDifficultyActorSize = 80;
const maxDifficultyActorSize = Math.max(30, minDifficultyActorSize);
const minDifficultyInterval = 200;
const maxDifficultyInterval = Math.max(4000, minDifficultyInterval);
const difficultyDiff = maxDifficultyInterval - minDifficultyInterval;
const difficultyWindow = 300;
const minDifficultyIncrement = 0.05;
const maxDifficultyIncrement = Math.max(0.1, minDifficultyIncrement);
let difficultyT = 0;

let container = document.querySelector(".container");
let scoreCounter = document.querySelector(".score-counter");
let chicky = document.querySelector(".chicky");

let score = 0;
scoreCounter.textContent = score.toString();

chicky.style.height = chicky.style.width = minDifficultyActorSize;

const lerp = (a, b, t) => a + (b - a) * t;

const getInterval = () => {
  const minInterval = maxDifficultyInterval - difficultyDiff * difficultyT;
  const maxInterval = Math.min(minInterval + difficultyWindow, maxDifficultyInterval);
  return lerp(minInterval, maxInterval, Math.random());
};

const randomizeChickyPosition = () => {
  const width = chicky.clientWidth;
  const maxX = Math.max(container.clientWidth - width, width);
  chicky.style.left = `${maxX * Math.random()}px`;

  const height = chicky.clientHeight;
  const maxY = Math.max(container.clientHeight - height, height);
  chicky.style.top = `${maxY * Math.random()}px`;
};
randomizeChickyPosition();
let randomizeIntervalId = setInterval(randomizeChickyPosition, getInterval());

const beep = () => {
  const beepInstance = new Audio(hitBase64);  
  beepInstance.play();
}
const onClick = (e) => {
  if (e.which !== 1) {
    return;
  }
  
  clearInterval(randomizeIntervalId);
  
  beep();
  scoreCounter.textContent = (++score).toString();
  
  const difficultyIncrement = lerp(minDifficultyIncrement, maxDifficultyIncrement, Math.random());
  difficultyT = Math.min(difficultyT + difficultyIncrement, 1);
  chicky.style.height = chicky.style.width = lerp(minDifficultyActorSize, maxDifficultyActorSize, difficultyT);
  randomizeChickyPosition();
  randomizeIntervalId = setInterval(randomizeChickyPosition, getInterval());
};
chicky.addEventListener("pointerdown", onClick);
